DROP USER Reimbursment CASCADE;
DROP TABLE REQUEST;
DROP TABLE EMPLOYEE;

/*******************************************************************************
   Create database
********************************************************************************/


CREATE USER Reimbursment
IDENTIFIED BY pR0jec0n3
DEFAULT TABLESPACE users
TEMPORARY TABLESPACE temp
QUOTA 10M ON users;

GRANT connect to Reimbursment;
GRANT resource to Reimbursment;
GRANT create session TO Reimbursment;
GRANT create table TO Reimbursment;
GRANT create view TO Reimbursment;

conn Reimbursment/pR0jec0n3


/*******************************************************************************
   Create tables
********************************************************************************/

create table EMPLOYEE(
    EMP_ID number primary key,
    USERNAME varchar2(20),
    PASS varchar2(20),
    EMAIL varchar2(50),
    FNAME varchar2(20),
    LNAME varchar2(20),
    PHONE number(10),
    SECONDARY number(10),
    STATE_ABR varchar2(2),
    MANAGER number(1) --boolean for isManager 
);

create table REQUEST(
    REQUEST_ID number primary key,
    EMP_ID number,
    AMOUNT number(9,2),
    STATUS number(1), --0 processing, 1 accepted, -1 rejected
    MAN_REVIEWED number,
    DESCRIPTION varchar2(400)
);

/*******************************************************************************
   Create Foreign Keys
********************************************************************************/
ALTER TABLE REQUEST ADD CONSTRAINT FK_REQUEST_EMP
    FOREIGN KEY (EMP_ID) REFERENCES EMPLOYEE (EMP_ID)  
    on delete cascade;

/*******************************************************************************
   Default values and sequences
********************************************************************************/






create sequence SQ_EMP_ID
START WITH 101
INCREMENT BY 1;

create sequence SQ_REQUEST_ID
START WITH 601
INCREMENT BY 1;

create or replace trigger TR_EMP_ID
before insert on EMPLOYEE
for each row
declare
    tmpval number;
BEGIN
    select SQ_EMP_ID.NEXTVAL into tmpval from DUAL;
    :NEW.EMP_ID := tmpval;
END;
/

create or replace trigger TR_REQUEST_ID
before insert on REQUEST
for each row
declare
    tmpval number;
BEGIN
    select SQ_REQUEST_ID.NEXTVAL into tmpval from DUAL;
    :NEW.REQUEST_ID := tmpval;
END;
/

SELECT r.REQUEST_ID, r.EMP_ID, r.AMOUNT, r.STATUS, r.DESCRIPTION, concat(e.FNAME, concat(' ',e.LNAME)) as EMP_NAME, 
c.EMP_ID, concat(c.FNAME, concat(' ',c.LNAME))
FROM REQUEST r LEFT JOIN EMPLOYEE e ON r.EMP_ID=e.EMP_ID LEFT JOIN EMPLOYEE c ON r.MAN_REVIEWED=c.EMP_ID  WHERE r.STATUS <> 0;

commit;
rollback;
